// Definition modules for importing png|svg|jpg|gif
declare module '*.png' {
    const content: any;
    export default content;
}
declare module '*.svg' {
    const content: unknown;
    export default content;
}
declare module '*.jpg' {
    const content: unknown;
    export default content;
}
declare module '*.gif' {
    const content: unknown;
    export default content;
}
